import React from 'react';

const Contact = () => {
  return (
    <section className='mt-44 px-10'>
        <div className='text-8xl  text-center px-0 flex'>Hi there! Can't find what you need?</div>
        <div className='text-base text-center justify-center flex'>Please get in touch and our support team will answer all your questions.</div>
        <div className='flex'>You can send a message to  <span className='ml-2'>neurox.co.uk</span></div>
    </section>
  )
}

export default Contact
